import web from "../src/images/s1.jpg";
import game from "../src/images/game.png";
import design from "../src/images/design.png";
import appmb from "../src/images/appmb.png";
import appdt from "../src/images/appdt.png";
import ecmr from "../src/images/ecmr.png";
import WEB from "./Web.jsx";

const Sdata = [
	{
		imgsrc: game,
		title: "Membangun Game",
		link: WEB
	},
	{
		imgsrc: web,
		title: "Web Development"
	},
	{
		imgsrc: design,
		title: "Design Graphics"
	},
	{
		imgsrc: appmb,
		title: "Aplikasi Android/IOS"
	},
	{
		imgsrc: appdt,
		title: "ApplikasiDesktop"
	},
	{
		imgsrc: ecmr,
		title: "E-Commerce"
	}
]


export default Sdata;
